
-- Create table (if not already done)
CREATE TABLE IF NOT EXISTS `retail` (
    `Invoice` VARCHAR(50),
    `Description` TEXT,
    `TotalPrice` DECIMAL(10,2),
    `Quantity` INT,
    `InvoiceDate` DATE,
    `Price` DECIMAL(10,2),
    `Country` VARCHAR(100)
);

-- Insert data

SELECT Country, SUM(TotalPrice) AS Revenue
FROM retail
GROUP BY Country
ORDER BY Revenue DESC;

SELECT Country, COUNT(*) AS Orders
FROM retail
GROUP BY Country
ORDER BY Orders DESC
LIMIT 5;

SELECT DATE(InvoiceDate) AS SaleDate, SUM(TotalPrice) AS DailySales
FROM retail
GROUP BY SaleDate
ORDER BY SaleDate;

SELECT Description, SUM(Quantity) AS total_sold
FROM retail
GROUP BY Description
ORDER BY total_sold DESC
LIMIT 10;

SELECT SUM(TotalPrice) AS revenue FROM retail;

SELECT COUNT(*) AS total_sales FROM retail;

SELECT DISTINCT Country FROM retail;

SELECT * FROM retail LIMIT 50;








